    "start"=>226.887,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"Jesus then said to them, \\\\u201cTruly, truly, I say to you, it was not Moses who gave you the bread from heaven, but my Father gives you the true bread from heaven. \\\\n\\\\t\\\\t\\\\t",
