    "book_sid"=>"John",
    "verse"=>34,
    "start"=>243.98,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"They said to him, \\\\u201cSir, give us this bread always.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
