    "book_sid"=>"John",
    "verse"=>38,
    "start"=>270.781,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"For I have come down from heaven, not to do my own will but the will of him who sent me. \\\\n\\\\t\\\\t\\\\t",
