    "book_sid"=>"John",
    "verse"=>39,
    "start"=>277.278,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"And this is the will of him who sent me, that I should lose nothing of all that he has given me, but raise it up on the last day. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>40,
    "start"=>286.066,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"For this is the will of my Father, that everyone who looks on the Son and believes in him should have eternal life, and I will raise him up on the last day.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>41,
    "start"=>296.874,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"So the Jews grumbled about him, because he said, \\\\u201cI am the bread that came down from heaven.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>42,
    "start"=>303.609,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"They said, \\\\u201cIs not this Jesus, the son of Joseph, whose father and mother we know? How does he now say, \\\\u2018I have come down from heaven\\\\u2019?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>43,
    "start"=>314.026,
    "chapter_text"=>"Chapter 6",
