    "book_sid"=>"John",
    "verse"=>45,
    "start"=>325.768,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"It is written in the Prophets, \\\\u2018And they will all be taught by God.\\\\u2019Everyone who has heard and learned from the Father comes to me\\\\u2014 \\\\n\\\\t\\\\t\\\\t",
