    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>47,
    "start"=>340.252,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"Truly, truly, I say to you, whoever believes has eternal life. \\\\n\\\\t\\\\t\\\\t",
