    "book_sid"=>"John",
    "verse"=>49,
    "start"=>348.477,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"Your fathers ate the manna in the wilderness, and they died. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>50,
    "start"=>352.278,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"This is the bread that comes down from heaven, so that one may eat of it and not die. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>51,
    "start"=>357.901,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"I am the living bread that came down from heaven. If anyone eats of this bread, he will live forever. And the bread that I will give for the life of the world is my flesh.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
