    "book_sid"=>"John",
    "verse"=>52,
    "start"=>369.795,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"The Jews then disputed among themselves, saying, \\\\u201cHow can this man give us his flesh to eat?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>53,
    "start"=>377.358,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"So Jesus said to them, \\\\u201cTruly, truly, I say to you, unless you eat the flesh of the Son of Man and drink his blood, you have no life in you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
