    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>56,
    "start"=>399.609,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"Whoever feeds on my flesh and drinks my blood abides in me, and I in him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>57,
    "start"=>406.066,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"As the living Father sent me, and I live because of the Father, so whoever feeds on me, he also will live because of me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>58,
    "start"=>415.437,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"This is the bread that came down from heaven, not like the bread the fathers ate and died. Whoever feeds on this bread will live forever.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>59,
    "start"=>424.821,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"Jesus said these things in the synagogue, as he taught at Capernaum. \\\\n\\\\t\\\\t\\\\t",
