    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>60,
    "start"=>429.093,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"When many of his disciples heard it, they said, \\\\u201cThis is a hard saying; who can listen to it?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
