    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>61,
    "start"=>436.013,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"But Jesus, knowing in himself that his disciples were grumbling about this, said to them, \\\\u201cDo you take offense at this? \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>62,
    "start"=>444.795,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"Then what if you were to see the Son of Man ascending to where he was before? \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>63,
    "start"=>449.901,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"It is the Spirit who gives life; the flesh is no help at all. The words that I have spoken to you are spirit and life. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>64,
    "start"=>458.954,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"But there are some of you who do not believe.\\\\u201d (For Jesus knew from the beginning who those were who did not believe, and who it was who would betray him.) \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>65,
    "start"=>469.119,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"And he said, \\\\u201cThis is why I told you that no one can come to me unless it is granted him by the Father.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>66,
    "start"=>476.318,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"After this many of his disciples turned back and no longer walked with him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>67,
    "start"=>481.146,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"So Jesus said to the Twelve, \\\\u201cDo you want to go away as well?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
