    "book_sid"=>"John",
    "verse"=>68,
    "start"=>486.026,
    "chapter_text"=>"Chapter 6",
    "verse_text"=>"Simon Peter answered him, \\\\u201cLord, to whom shall we go? You have the words of eternal life, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>6,
    "book"=>"John",
    "part"=>71
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>69,
    "start"=>495.132,
    "chapter_text"=>"Chapter 6",
