    "book_sid"=>"John",
    "verse"=>1,
    "start"=>3.106,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"After this Jesus went about in Galilee. He would not go about in Judea, because the Jews were seeking to kill him. \\\\n\\\\t\\\\t\\\\t",
