    "part"=>72
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>3,
    "start"=>13.609,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"So his brothers said to him, \\\\u201cLeave here and go to Judea, that your disciples also may see the works you are doing. \\\\n\\\\t\\\\t\\\\t",
