    "book_sid"=>"John",
    "verse"=>4,
    "start"=>20.477,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"For no one works in secret if he seeks to be known openly. If you do these things, show yourself to the world.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
