    "book"=>"John",
    "part"=>72
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>5,
    "start"=>27.119,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"For not even his brothers believed in him. \\\\n\\\\t\\\\t\\\\t",
