    "no"=>58,
    "book_sid"=>"John",
    "verse"=>6,
    "start"=>30.185,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"Jesus said to them, \\\\u201cMy time has not yet come, but your time is always here. \\\\n\\\\t\\\\t\\\\t",
