    "book_sid"=>"John",
    "verse"=>7,
    "start"=>37.013,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"The world cannot hate you, but it hates me because I testify about it that its works are evil. \\\\n\\\\t\\\\t\\\\t",
