    "book_sid"=>"John",
    "verse"=>8,
    "start"=>43.927,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"You go up to the feast. I am not going up to this feast, for my time has not yet fully come.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>7,
    "book"=>"John",
    "part"=>72
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>9,
    "start"=>50.795,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"After saying this, he remained in Galilee. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>7,
    "book"=>"John",
    "part"=>72
  },
