    "book_sid"=>"John",
    "verse"=>10,
    "start"=>53.954,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"But after his brothers had gone up to the feast, then he also went up, not publicly but in private. \\\\n\\\\t\\\\t\\\\t",
