    "book_sid"=>"John",
    "verse"=>11,
    "start"=>60.371,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"The Jews were looking for him at the feast, and saying, \\\\u201cWhere is he?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>7,
    "book"=>"John",
    "part"=>72
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>12,
    "start"=>65.662,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"And there was much muttering about him among the people. While some said, \\\\u201cHe is a good man,\\\\u201d others said, \\\\u201cNo, he is leading the people astray.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>7,
    "book"=>"John",
    "part"=>72
  },
  {
