    "book_sid"=>"John",
    "verse"=>13,
    "start"=>78.066,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"Yet for fear of the Jews no one spoke openly of him. \\\\n\\\\t\\\\t\\\\t",
