    "book_sid"=>"John",
    "verse"=>15,
    "start"=>86.371,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"The Jews therefore marveled, saying, \\\\u201cHow is it that this man has learning, when he has never studied?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
