    "chapter_text"=>"Chapter 7",
    "verse_text"=>"If anyone\\\\u2019s will is to do God\\\\u2019s will, he will know whether the teaching is from God or whether I am speaking on my own authority. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>7,
    "book"=>"John",
    "part"=>72
  },
  {
