    "book_sid"=>"John",
    "verse"=>18,
    "start"=>107.742,
    "chapter_text"=>"Chapter 7",
    "verse_text"=>"The one who speaks on his own authority seeks his own glory; but the one who seeks the glory of him who sent him is true, and in him there is no falsehood. \\\\n\\\\t\\\\t\\\\t",
