    "chap_no"=>14,
    "book"=>"John",
    "part"=>79
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>28,
    "start"=>224.371,
    "chapter_text"=>"Chapter 14",
    "verse_text"=>"You heard me say to you, \\\\u2018I am going away, and I will come to you.\\\\u2019If you loved me, you would have rejoiced, because I am going to the Father, for the Father is greater than I. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>14,
    "book"=>"John",
    "part"=>79
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>29,
    "start"=>238.172,
    "chapter_text"=>"Chapter 14",
    "verse_text"=>"And now I have told you before it takes place, so that when it does take place you may believe. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>14,
    "book"=>"John",
    "part"=>79
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>30,
    "start"=>244.901,
    "chapter_text"=>"Chapter 14",
    "verse_text"=>"I will no longer talk much with you, for the ruler of this world is coming. He has no claim on me, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>14,
    "book"=>"John",
    "part"=>79
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>31,
    "start"=>251.954,
    "chapter_text"=>"Chapter 14",
    "verse_text"=>"but I do as the Father has commanded me, so that the world may know that I love the Father. Rise, let us go from here. \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
    "chap_no"=>14,
    "book"=>"John",
    "part"=>79
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>1,
    "start"=>3.252,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"\\\\u201cI am the true vine, and my Father is the vinedresser. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>2,
    "start"=>7.609,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"Every branch in me that does not bear fruit he takes away, and every branch that does bear fruit he prunes, that it may bear more fruit. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>3,
    "start"=>16.57,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"Already you are clean because of the word that I have spoken to you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>4,
    "start"=>21.358,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"Abide in me, and I in you. As the branch cannot bear fruit by itself, unless it abides in the vine, neither can you, unless you abide in me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>5,
    "start"=>32.874,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"I am the vine; you are the branches. Whoever abides in me and I in him, he it is that bears much fruit, for apart from me you can do nothing. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>6,
    "start"=>44.397,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"If anyone does not abide in me he is thrown away like a branch and withers; and the branches are gathered, thrown into the fire, and burned. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>7,
    "start"=>53.768,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"If you abide in me, and my words abide in you, ask whatever you wish, and it will be done for you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>8,
    "start"=>60.967,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"By this my Father is glorified, that you bear much fruit and so prove to be my disciples. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>9,
    "start"=>67.98,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"As the Father has loved me, so have I loved you. Abide in my love. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>10,
    "start"=>74.212,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"If you keep my commandments, you will abide in my love, just as I have kept my Father\\\\u2019s commandments and abide in his love. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>11,
    "start"=>81.914,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"These things I have spoken to you, that my joy may be in you, and that your joy may be full. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>12,
    "start"=>88.517,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"\\\\u201cThis is my commandment, that you love one another as I have loved you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>13,
    "start"=>93.384,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"Greater love has no one than this, that someone lay down his life for his friends. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>14,
    "start"=>99.013,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"You are my friends if you do what I command you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>15,
    "start"=>102.954,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"No longer do I call you servants, for the servant does not know what his master is doing; but I have called you friends, for all that I have heard from my Father I have made known to you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>16,
    "start"=>115.45,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"You did not choose me, but I chose you and appointed you that you should go and bear fruit and that your fruit should abide, so that whatever you ask the Father in my name, he may give it to you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>17,
    "start"=>127.609,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"These things I command you, so that you will love one another. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>18,
    "start"=>132.265,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"\\\\u201cIf the world hates you, know that it has hated me before it hated you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>19,
    "start"=>137.742,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"If you were of the world, the world would love you as its own; but because you are not of the world, but I chose you out of the world, therefore the world hates you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>20,
    "start"=>148.093,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"Remember the word that I said to you: \\\\u2018A servant is not greater than his master.\\\\u2019If they persecuted me, they will also persecute you. If they kept my word, they will also keep yours. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>21,
    "start"=>161.702,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"But all these things they will do to you on account of my name, because they do not know him who sent me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>22,
    "start"=>168.199,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"If I had not come and spoken to them, they would not have been guilty of sin, but now they have no excuse for their sin. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>23,
    "start"=>176.609,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"Whoever hates me hates my Father also. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>24,
    "start"=>180.225,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"If I had not done among them the works that no one else did, they would not be guilty of sin, but now they have seen and hated both me and my Father. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>25,
    "start"=>189.477,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"But the word that is written in their Law must be fulfilled: \\\\u2018They hated me without a cause.\\\\u2019 \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>26,
    "start"=>196.755,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"\\\\u201cBut when the Helper comes, whom I will send to you from the Father, the Spirit of truth, who proceeds from the Father, he will bear witness about me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>27,
    "start"=>206.927,
    "chapter_text"=>"Chapter 15",
    "verse_text"=>"And you also will bear witness, because you have been with me from the beginning. \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
    "chap_no"=>15,
    "book"=>"John",
    "part"=>80
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>1,
    "start"=>3.344,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"\\\\u201cI have said all these things to you to keep you from falling away. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>2,
    "start"=>7.477,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"They will put you out of the synagogues. Indeed, the hour is coming when whoever kills you will think he is offering service to God. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>3,
    "start"=>15.649,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And they will do these things because they have not known the Father, nor me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>4,
    "start"=>20.477,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"But I have said these things to you, that when their hour comes you may remember that I told them to you. \\\\u201cI did not say these things to you from the beginning, because I was with you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>5,
    "start"=>32.132,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"But now I am going to him who sent me, and none of you asks me, \\\\u2018Where are you going?\\\\u2019 \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>6,
    "start"=>37.238,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"But because I have said these things to you, sorrow has filled your heart. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>7,
    "start"=>41.517,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"Nevertheless, I tell you the truth: it is to your advantage that I go away, for if I do not go away, the Helper will not come to you. But if I go, I will send him to you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>8,
    "start"=>53.914,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And when he comes, he will convict the world concerning sin and righteousness and judgment: \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>9,
    "start"=>60.093,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"concerning sin, because they do not believe in me; \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>10,
    "start"=>63.384,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"concerning righteousness, because I go to the Father, and you will see me no longer; \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>11,
    "start"=>68.225,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"concerning judgment, because the ruler of this world is judged. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>12,
    "start"=>72.861,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"\\\\u201cI still have many things to say to you, but you cannot bear them now. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>13,
    "start"=>78.106,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"When the Spirit of truth comes, he will guide you into all the truth, for he will not speak on his own authority, but whatever he hears he will speak, and he will declare to you the things that are to come. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>14,
    "start"=>92.185,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"He will glorify me, for he will take what is mine and declare it to you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>15,
    "start"=>98.45,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"All that the Father has is mine; therefore I said that he will take what is mine and declare it to you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>16,
    "start"=>104.623,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"\\\\u201cA little while, and you will see me no longer; and again a little while, and you will see me.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>17,
    "start"=>111.04,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"So some of his disciples said to one another, \\\\u201cWhat is this that he says to us, \\\\u2018A little while, and you will not see me, and again a little while, and you will see me\\\\u2019; and, \\\\u2018because I am going to the Father\\\\u2019?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>18,
    "start"=>127.146,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"So they were saying, \\\\u201cWhat does he mean by \\\\u2018a little while\\\\u2019? We do not know what he is talking about.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>19,
    "start"=>134.715,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"Jesus knew that they wanted to ask him, so he said to them, \\\\u201cIs this what you are asking yourselves, what I meant by saying, \\\\u2018A little while and you will not see me, and again a little while and you will see me\\\\u2019? \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>20,
    "start"=>148.093,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"Truly, truly, I say to you, you will weep and lament, but the world will rejoice. You will be sorrowful, but your sorrow will turn into joy. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>21,
    "start"=>158.728,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"When a woman is giving birth, she has sorrow because her hour has come, but when she has delivered the baby, she no longer remembers the anguish, for joy that a human being has been born into the world. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>22,
    "start"=>170.848,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"So also you have sorrow now, but I will see you again, and your hearts will rejoice, and no one will take your joy from you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>23,
    "start"=>179.53,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"In that day you will ask nothing of me. Truly, truly, I say to you, whatever you ask of the Father in my name, he will give it to you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>24,
    "start"=>188.49,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"Until now you have asked nothing in my name. Ask, and you will receive, that your joy may be full. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>25,
    "start"=>195.742,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"\\\\u201cI have said these things to you in figures of speech. The hour is coming when I will no longer speak to you in figures of speech but will tell you plainly about the Father. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
    "book_sid"=>"John",
    "verse"=>26,
    "start"=>205.914,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"In that day you will ask in my name, and I do not say to you that I will ask the Father on your behalf; \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"John",
    "part"=>81
  },
  {
    "no"=>58,
