  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>10,
    "start"=>71.331,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And when Paul had seen the vision, immediately we sought to go on into Macedonia, concluding that God had called us to preach the gospel to them. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>11,
    "start"=>80.795,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"So, setting sail from Troas, we made a direct voyage to Samothrace, and the following day to Neapolis, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>12,
    "start"=>87.596,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"and from there to Philippi, which is a leading city of the district of Macedonia and a Roman colony. We remained in this city some days. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>13,
    "start"=>98.649,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And on the Sabbath day we went outside the gate to the riverside, where we supposed there was a place of prayer, and we sat down and spoke to the women who had come together. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>14,
    "start"=>108.464,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"One who heard us was a woman named Lydia, from the city of Thyatira, a seller of purple goods, who was a worshiper of God. The Lord opened her heart to pay attention to what was said by Paul. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>15,
    "start"=>121.079,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And after she was baptized, and her household as well, she urged us, saying, \\\\u201cIf you have judged me to be faithful to the Lord, come to my house and stay.\\\\u201d And she prevailed upon us. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>16,
    "start"=>134.517,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"As we were going to the place of prayer, we were met by a slave girl who had a spirit of divination and brought her owners much gain by fortune-telling. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>17,
    "start"=>143.199,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"She followed Paul and us, crying out, \\\\u201cThese men are servants of the Most High God, who proclaim to you the way of salvation.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>18,
    "start"=>157.066,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And this she kept doing for many days. Paul, having become greatly annoyed, turned and said to the spirit, \\\\u201cI command you in the name of Jesus Christ to come out of her.\\\\u201d And it came out that very hour. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>19,
    "start"=>172.848,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"But when her owners saw that their hope of gain was gone, they seized Paul and Silas and dragged them into the marketplace before the rulers. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>20,
    "start"=>181.358,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And when they had brought them to the magistrates, they said, \\\\u201cThese men are Jews, and they are disturbing our city. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>187.94,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"They advocate customs that are not lawful for us as Romans to accept or practice.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>193.199,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"The crowd joined in attacking them, and the magistrates tore the garments off them and gave orders to beat them with rods. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>199.477,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And when they had inflicted many blows upon them, they threw them into prison, ordering the jailer to keep them safely. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>206.821,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"Having received this order, he put them into the inner prison and fastened their feet in the stocks. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>212.596,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"About midnight Paul and Silas were praying and singing hymns to God, and the prisoners were listening to them, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>26,
    "start"=>219.596,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"and suddenly there was a great earthquake, so that the foundations of the prison were shaken. And immediately all the doors were opened, and everyone\\\\u2019s bonds were unfastened. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>27,
    "start"=>230.331,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"When the jailer woke and saw that the prison doors were open, he drew his sword and was about to kill himself, supposing that the prisoners had escaped. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>28,
    "start"=>239,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"But Paul cried with a loud voice, \\\\u201cDo not harm yourself, for we are all here.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>29,
    "start"=>246.556,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And the jailer called for lights and rushed in, and trembling with fear he fell down before Paul and Silas. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>30,
    "start"=>253.093,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"Then he brought them out and said, \\\\u201cSirs, what must I do to be saved?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>31,
    "start"=>259.132,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And they said, \\\\u201cBelieve in the Lord Jesus, and you will be saved, you and your household.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>32,
    "start"=>267.728,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And they spoke the word of the Lord to him and to all who were in his house. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>33,
    "start"=>272.371,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And he took them the same hour of the night and washed their wounds; and he was baptized at once, he and all his family. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>34,
    "start"=>280.291,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"Then he brought them up into his house and set food before them. And he rejoiced along with his entire household that he had believed in God. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>35,
    "start"=>289.424,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"But when it was day, the magistrates sent the police, saying, \\\\u201cLet those men go.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>36,
    "start"=>293.795,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"And the jailer reported these words to Paul, saying, \\\\u201cThe magistrates have sent to let you go. Therefore come out now and go in peace.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>37,
    "start"=>303.662,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"But Paul said to them, \\\\u201cThey have beaten us publicly, uncondemned, men who are Roman citizens, and have thrown us into prison; and do they now throw us out secretly? No! Let them come themselves and take us out.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>38,
    "start"=>320.623,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"The police reported these words to the magistrates, and they were afraid when they heard that they were Roman citizens. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>39,
    "start"=>326.689,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"So they came and apologized to them. And they took them out and asked them to leave the city. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>40,
    "start"=>331.503,
    "chapter_text"=>"Chapter 16",
    "verse_text"=>"So they went out of the prison and visited Lydia. And when they had seen the brothers, they encouraged them and departed. \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
    "chap_no"=>16,
    "book"=>"Acts",
    "part"=>101
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>1,
    "start"=>3.291,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"Now when they had passed through Amphipolis and Apollonia, they came to Thessalonica, where there was a synagogue of the Jews. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>2,
    "start"=>10.861,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"And Paul went in, as was his custom, and on three Sabbath days he reasoned with them from the Scriptures, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>3,
    "start"=>17.318,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"explaining and proving that it was necessary for the Christ to suffer and to rise from the dead, and saying, \\\\u201cThis Jesus, whom I proclaim to you, is the Christ.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>4,
    "start"=>30.04,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"And some of them were persuaded and joined Paul and Silas, as did a great many of the devout Greeks and not a few of the leading women. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>5,
    "start"=>38.543,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"But the Jews were jealous, and taking some wicked men of the rabble, they formed a mob, set the city in an uproar, and attacked the house of Jason, seeking to bring them out to the crowd. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>6,
    "start"=>48.848,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"And when they could not find them, they dragged Jason and some of the brothers before the city authorities, shouting, \\\\u201cThese men who have turned the world upside down have come here also, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>7,
    "start"=>59.715,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"and Jason has received them, and they are all acting against the decrees of Caesar, saying that there is another king, Jesus.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>8,
    "start"=>71.053,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"And the people and the city authorities were disturbed when they heard these things. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>9,
    "start"=>75.185,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"And when they had taken money as security from Jason and the rest, they let them go. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>10,
    "start"=>80.199,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"The brothers immediately sent Paul and Silas away by night to Berea, and when they arrived they went into the Jewish synagogue. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>11,
    "start"=>87.437,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"Now these Jews were more noble than those in Thessalonica; they received the word with all eagerness, examining the Scriptures daily to see if these things were so. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>12,
    "start"=>99.146,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"Many of them therefore believed, with not a few Greek women of high standing as well as men. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>13,
    "start"=>104.954,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"But when the Jews from Thessalonica learned that the word of God was proclaimed by Paul at Berea also, they came there too, agitating and stirring up the crowds. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>14,
    "start"=>114.834,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"Then the brothers immediately sent Paul off on his way to the sea, but Silas and Timothy remained there. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>15,
    "start"=>121.252,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"Those who conducted Paul brought him as far as Athens, and after receiving a command for Silas and Timothy to come to him as soon as possible, they departed. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>16,
    "start"=>130.768,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"Now while Paul was waiting for them at Athens, his spirit was provoked within him as he saw that the city was full of idols. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>17,
    "start"=>137.874,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"So he reasoned in the synagogue with the Jews and the devout persons, and in the marketplace every day with those who happened to be there. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>18,
    "start"=>146,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"Some of the Epicurean and Stoic philosophers also conversed with him. And some said, \\\\u201cWhat does this babbler wish to say?\\\\u201d Others said, \\\\u201cHe seems to be a preacher of foreign divinities\\\\u201d\\\\u2014because he was preaching Jesus and the resurrection. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>19,
    "start"=>162.212,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"And they took him and brought him to the Areopagus, saying, \\\\u201cMay we know what this new teaching is that you are presenting? \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>20,
    "start"=>169.172,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"For you bring some strange things to our ears. We wish to know therefore what these things mean.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>174.371,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"Now all the Athenians and the foreigners who lived there would spend their time in nothing except telling or hearing something new. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>181.98,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"So Paul, standing in the midst of the Areopagus, said: \\\\u201cMen of Athens, I perceive that in every way you are very religious. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>193.649,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"For as I passed along and observed the objects of your worship, I found also an altar with this inscription, \\\\u2018To the unknown god.\\\\u2019What therefore you worship as unknown, this I proclaim to you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>210.728,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"The God who made the world and everything in it, being Lord of heaven and earth, does not live in temples made by man, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>220.768,
    "chapter_text"=>"Chapter 17",
    "verse_text"=>"nor is he served by human hands, as though he needed anything, since he himself gives to all mankind life and breath and everything. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>17,
    "book"=>"Acts",
    "part"=>102
  },
  {
