  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>169.079,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"Now after these events Paul resolved in the Spirit to pass through Macedonia and Achaia and go to Jerusalem, saying, \\\\u201cAfter I have been there, I must also see Rome.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>182.04,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"And having sent into Macedonia two of his helpers, Timothy and Erastus, he himself stayed in Asia for a while. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>190.437,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"About that time there arose no little disturbance concerning the Way. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>195.636,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"For a man named Demetrius, a silversmith, who made silver shrines of Artemis, brought no little business to the craftsmen. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>203.397,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"These he gathered together, with the workmen in similar trades, and said, \\\\u201cMen, you know that from this business we have our wealth. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>26,
    "start"=>212.543,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"And you see and hear that not only in Ephesus but in almost all of Asia this Paul has persuaded and turned away a great many people, saying that gods made with hands are not gods. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>27,
    "start"=>225.781,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"And there is danger not only that this trade of ours may come into disrepute but also that the temple of the great goddess Artemis may be counted as nothing, and that she may even be deposed from her magnificence, she whom all Asia and the world worship.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>28,
    "start"=>243.424,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"When they heard this they were enraged and were crying out, \\\\u201cGreat is Artemis of the Ephesians!\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>29,
    "start"=>250.808,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"So the city was filled with the confusion, and they rushed together into the theater, dragging with them Gaius and Aristarchus, Macedonians who were Paul\\\\u2019s companions in travel. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>30,
    "start"=>261.543,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"But when Paul wished to go in among the crowd, the disciples would not let him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>31,
    "start"=>266,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"And even some of the Asiarchs, who were friends of his, sent to him and were urging him not to venture into the theater. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>32,
    "start"=>272.728,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"Now some cried out one thing, some another, for the assembly was in confusion, and most of them did not know why they had come together. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>33,
    "start"=>280.768,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"Some of the crowd prompted Alexander, whom the Jews had put forward. And Alexander, motioning with his hand, wanted to make a defense to the crowd. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>34,
    "start"=>290.053,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"But when they recognized that he was a Jew, for about two hours they all cried out with one voice, \\\\u201cGreat is Artemis of the Ephesians!\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>35,
    "start"=>301.066,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"And when the town clerk had quieted the crowd, he said, \\\\u201cMen of Ephesus, who is there who does not know that the city of the Ephesians is temple keeper of the great Artemis, and of the sacred stone that fell from the sky? \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>36,
    "start"=>317.411,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"Seeing then that these things cannot be denied, you ought to be quiet and do nothing rash. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>37,
    "start"=>323.954,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"For you have brought these men here who are neither sacrilegious nor blasphemers of our goddess. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>38,
    "start"=>330.728,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"If therefore Demetrius and the craftsmen with him have a complaint against anyone, the courts are open, and there are proconsuls. Let them bring charges against one another. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>39,
    "start"=>342.53,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"But if you seek anything further, it shall be settled in the regular assembly. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>19,
    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>40,
    "start"=>347.954,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"For we really are in danger of being charged with rioting today, since there is no cause that we can give to justify this commotion.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
