    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>41,
    "start"=>357.477,
    "chapter_text"=>"Chapter 19",
    "verse_text"=>"And when he had said these things, he dismissed the assembly. \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
