    "book"=>"Acts",
    "part"=>104
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>1,
    "start"=>2.914,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"After the uproar ceased, Paul sent for the disciples, and after encouraging them, he said farewell and departed for Macedonia. \\\\n\\\\t\\\\t\\\\t",
