    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>3,
    "start"=>15.874,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"There he spent three months, and when a plot was made against him by the Jews as he was about to set sail for Syria, he decided to return through Macedonia. \\\\n\\\\t\\\\t\\\\t",
