    "book_sid"=>"Acts",
    "verse"=>4,
    "start"=>25.675,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"Sopater the Berean, son of Pyrrhus, accompanied him; and of the Thessalonians, Aristarchus and Secundus; and Gaius of Derbe, and Timothy; and the Asians, Tychicus and Trophimus. \\\\n\\\\t\\\\t\\\\t",
