    "chapter_text"=>"Chapter 20",
    "verse_text"=>"On the first day of the week, when we were gathered together to break bread, Paul talked with them, intending to depart on the next day, and he prolonged his speech until midnight. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
