    "chapter_text"=>"Chapter 20",
    "verse_text"=>"But Paul went down and bent over him, and taking him in his arms, said, \\\\u201cDo not be alarmed, for his life is in him.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
