    "start"=>87.954,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"And when Paul had gone up and had broken bread and eaten, he conversed with them a long while, until daybreak, and so departed. \\\\n\\\\t\\\\t\\\\t",
