    "verse"=>12,
    "start"=>95.159,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"And they took the youth away alive, and were not a little comforted. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>13,
    "start"=>99.424,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"But going ahead to the ship, we set sail for Assos, intending to take Paul aboard there, for so he had arranged, intending himself to go by land. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>14,
    "start"=>109.358,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"And when he met us at Assos, we took him on board and went to Mitylene. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
