    "book_sid"=>"Acts",
    "verse"=>16,
    "start"=>123.305,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"For Paul had decided to sail past Ephesus, so that he might not have to spend time in Asia, for he was hastening to be at Jerusalem, if possible, on the day of Pentecost. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>17,
    "start"=>134.358,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"Now from Miletus he sent to Ephesus and called the elders of the church to come to him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>18,
    "start"=>139.291,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"And when they came to him, he said to them: \\\\u201cYou yourselves know how I lived among you the whole time from the first day that I set foot in Asia, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>19,
    "start"=>148.848,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"serving the Lord with all humility and with tears and with trials that happened to me through the plots of the Jews; \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>20,
    "start"=>156.556,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"how I did not shrink from declaring to you anything that was profitable, and teaching you in public and from house to house, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>164.225,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"testifying both to Jews and to Greeks of repentance toward God and of faith in our Lord Jesus Christ. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>172.715,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"And now, behold, I am going to Jerusalem, constrained bythe Spirit, not knowing what will happen to me there, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>180.848,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"except that the Holy Spirit testifies to me in every city that imprisonment and afflictions await me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>188.185,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"But I do not account my life of any value nor as precious to myself, if only I may finish my course and the ministry that I received from the Lord Jesus, to testify to the gospel of the grace of God. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>203.596,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"And now, behold, I know that none of you among whom I have gone about proclaiming the kingdom will see my face again. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>26,
    "start"=>212.795,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"Therefore I testify to you this day that I am innocent of the blood of all of you, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>27,
    "start"=>219.53,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"for I did not shrink from declaring to you the whole counsel of God. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
