    "book_sid"=>"Acts",
    "verse"=>28,
    "start"=>224.265,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"Pay careful attention to yourselves and to all the flock, in which the Holy Spirit has made you overseers, to care for the church of God, which he obtained with his own blood. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>29,
    "start"=>237.278,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"I know that after my departure fierce wolves will come in among you, not sparing the flock; \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>30,
    "start"=>244.742,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"and from among your own selves will arise men speaking twisted things, to draw away the disciples after them. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
