    "book_sid"=>"Acts",
    "verse"=>31,
    "start"=>252.967,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"Therefore be alert, remembering that for three years I did not cease night or day to admonish everyone with tears. \\\\n\\\\t\\\\t\\\\t",
