    "book_sid"=>"Acts",
    "verse"=>32,
    "start"=>263.093,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"And now I commend you to God and to the word of his grace, which is able to build you up and to give you the inheritance among all those who are sanctified. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>33,
    "start"=>276,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"I coveted no one\\\\u2019s silver or gold or apparel. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>34,
    "start"=>279.715,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"You yourselves know that these hands ministered to my necessities and to those who were with me. \\\\n\\\\t\\\\t\\\\t",
