    "book_sid"=>"Acts",
    "verse"=>35,
    "start"=>287.013,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"In all things I have shown you that by working hard in this way we must help the weak and remember the words of the Lord Jesus, how he himself said, \\\\u2018It is more blessed to give than to receive.\\\\u2019\\\\u201d \\\\n\\\\t\\\\t\\\\t",
