    "book_sid"=>"Acts",
    "verse"=>36,
    "start"=>301.04,
    "chapter_text"=>"Chapter 20",
    "verse_text"=>"And when he had said these things, he knelt down and prayed with them all. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>20,
    "book"=>"Acts",
    "part"=>105
  },
