    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>15,
    "start"=>146.795,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"for you will be a witness for him to everyone of what you have seen and heard. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>16,
    "start"=>152.464,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"And now why do you wait? Rise and be baptized and wash away your sins, calling on his name.\\\\u2019 \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>17,
    "start"=>161.795,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"\\\\u201cWhen I had returned to Jerusalem and was praying in the temple, I fell into a trance \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>18,
    "start"=>167.874,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"and saw him saying to me, \\\\u2018Make haste and get out of Jerusalem quickly, because they will not accept your testimony about me.\\\\u2019 \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>19,
    "start"=>176.887,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"And I said, \\\\u2018Lord, they themselves know that in one synagogue after another I imprisoned and beat those who believed in you. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>20,
    "start"=>185.702,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"And when the blood of Stephen your witness was being shed, I myself was standing by and approving and watching over the garments of those who killed him.\\\\u2019 \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>196.49,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"And he said to me, \\\\u2018Go, for I will send you far away to the Gentiles.\\\\u2019\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>204.57,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"Up to this word they listened to him. Then they raised their voices and said, \\\\u201cAway with such a fellow from the earth! For he should not be allowed to live.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>215.252,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"And as they were shouting and throwing off their cloaks and flinging dust into the air, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>220.026,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"the tribune ordered him to be brought into the barracks, saying that he should be examined by flogging, to find out why they were shouting against him like this. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>228.344,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"But when they had stretched him out for the whips, Paul said to the centurion who was standing by, \\\\u201cIs it lawful for you to flog a man who is a Roman citizen and uncondemned?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>26,
    "start"=>238.238,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"When the centurion heard this, he went to the tribune and said to him, \\\\u201cWhat are you about to do? For this man is a Roman citizen.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>27,
    "start"=>246.914,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"So the tribune came and said to him, \\\\u201cTell me, are you a Roman citizen?\\\\u201d And he said, \\\\u201cYes.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>28,
    "start"=>254.715,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"The tribune answered, \\\\u201cI bought this citizenship for a large sum.\\\\u201d Paul said, \\\\u201cBut I am a citizen by birth.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>29,
    "start"=>263.728,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"So those who were about to examine him withdrew from him immediately, and the tribune also was afraid, for he realized that Paul was a Roman citizen and that he had bound him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>30,
    "start"=>274.874,
    "chapter_text"=>"Chapter 22",
    "verse_text"=>"But on the next day, desiring to know the real reason why he was being accused by the Jews, he unbound him and commanded the chief priests and all the council to meet, and he brought Paul down and set him before them. \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
    "chap_no"=>22,
    "book"=>"Acts",
    "part"=>107
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>1,
    "start"=>3.437,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And looking intently at the council, Paul said, \\\\u201cBrothers, I have lived my life before God in all good conscience up to this day.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>2,
    "start"=>14.159,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And the high priest Ananias commanded those who stood by him to strike him on the mouth. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>3,
    "start"=>19.265,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"Then Paul said to him, \\\\u201cGod is going to strike you, you whitewashed wall! Are you sitting to judge me according to the law, and yet contrary to the law you order me to be struck?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>4,
    "start"=>31.437,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"Those who stood by said, \\\\u201cWould you revile God\\\\u2019s high priest?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>5,
    "start"=>37.053,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And Paul said, \\\\u201cI did not know, brothers, that he was the high priest, for it is written, \\\\u2018You shall not speak evil of a ruler of your people.\\\\u2019\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>6,
    "start"=>47.503,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"Now when Paul perceived that one part were Sadducees and the other Pharisees, he cried out in the council, \\\\u201cBrothers, I am a Pharisee, a son of Pharisees. It is with respect to the hope and the resurrection of the dead that I am on trial.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>7,
    "start"=>65.252,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And when he had said this, a dissension arose between the Pharisees and the Sadducees, and the assembly was divided. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>8,
    "start"=>72.212,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"For the Sadducees say that there is no resurrection, nor angel, nor spirit, but the Pharisees acknowledge them all. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>9,
    "start"=>79.411,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"Then a great clamor arose, and some of the scribes of the Pharisees\\\\u2019 party stood up and contended sharply, \\\\u201cWe find nothing wrong in this man. What if a spirit or an angel spoke to him?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>10,
    "start"=>94.079,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And when the dissension became violent, the tribune, afraid that Paul would be torn to pieces by them, commanded the soldiers to go down and take him away from among them by force and bring him into the barracks. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>11,
    "start"=>106.212,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"The following night the Lord stood by him and said, \\\\u201cTake courage, for as you have testified to the facts about me in Jerusalem, so you must testify also in Rome.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>12,
    "start"=>119.026,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"When it was day, the Jews made a plot and bound themselves by an oath neither to eat nor drink till they had killed Paul. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>13,
    "start"=>127.238,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"There were more than forty who made this conspiracy. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>14,
    "start"=>130.397,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"They went to the chief priests and elders and said, \\\\u201cWe have strictly bound ourselves by an oath to taste no food till we have killed Paul. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>15,
    "start"=>139.358,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"Now therefore you, along with the council, give notice to the tribune to bring him down to you, as though you were going to determine his case more exactly. And we are ready to kill him before he comes near.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>16,
    "start"=>152.781,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"Now the son of Paul\\\\u2019s sister heard of their ambush, so he went and entered the barracks and told Paul. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>17,
    "start"=>158.728,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"Paul called one of the centurions and said, \\\\u201cTake this young man to the tribune, for he has something to tell him.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>18,
    "start"=>165.649,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"So he took him and brought him to the tribune and said, \\\\u201cPaul the prisoner called me and asked me to bring this young man to you, as he has something to say to you.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>19,
    "start"=>175.583,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"The tribune took him by the hand, and going aside asked him privately, \\\\u201cWhat is it that you have to tell me?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>20,
    "start"=>182.093,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And he said, \\\\u201cThe Jews have agreed to ask you to bring Paul down to the council tomorrow, as though they were going to inquire somewhat more closely about him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>191.093,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"But do not be persuaded by them, for more than forty of their men are lying in ambush for him, who have bound themselves by an oath neither to eat nor drink till they have killed him. And now they are ready, waiting for your consent.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>204.146,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"So the tribune dismissed the young man, charging him, \\\\u201cTell no one that you have informed me of these things.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>210.781,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"Then he called two of the centurions and said, \\\\u201cGet ready two hundred soldiers, with seventy horsemen and two hundred spearmen to go as far as Caesarea at the third hour of the night. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>220.675,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"Also provide mounts for Paul to ride and bring him safely to Felix the governor.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>224.715,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And he wrote a letter to this effect: \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>26,
    "start"=>227.371,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"\\\\u201cClaudius Lysias, to his Excellency the governor Felix, greetings. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>27,
    "start"=>232.106,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"This man was seized by the Jews and was about to be killed by them when I came upon them with the soldiers and rescued him, having learned that he was a Roman citizen. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>28,
    "start"=>240,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And desiring to know the charge for which they were accusing him, I brought him down to their council. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>29,
    "start"=>244.636,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"I found that he was being accused about questions of their law, but charged with nothing deserving death or imprisonment. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>30,
    "start"=>250.397,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And when it was disclosed to me that there would be a plot against the man, I sent him to you at once, ordering his accusers also to state before you what they have against him.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>31,
    "start"=>259.04,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"So the soldiers, according to their instructions, took Paul and brought him by night to Antipatris. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>32,
    "start"=>264.477,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"And on the next day they returned to the barracks, letting the horsemen go on with him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>33,
    "start"=>269.344,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"When they had come to Caesarea and delivered the letter to the governor, they presented Paul also before him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>34,
    "start"=>275.848,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"On reading the letter, he asked what province he was from. And when he learned that he was from Cilicia, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>35,
    "start"=>282,
    "chapter_text"=>"Chapter 23",
    "verse_text"=>"he said, \\\\u201cI will give you a hearing when your accusers arrive.\\\\u201d And he commanded him to be guarded in Herod\\\\u2019s praetorium. \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
    "chap_no"=>23,
    "book"=>"Acts",
    "part"=>108
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>1,
    "start"=>3.437,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"And after five days the high priest Ananias came down with some elders and a spokesman, one Tertullus. They laid before the governor their case against Paul. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>2,
    "start"=>13.331,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"And when he had been summoned, Tertullus began to accuse him, saying: \\\\u201cSince through you we enjoy much peace, and since by your foresight, most excellent Felix, reforms are being made for this nation, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>3,
    "start"=>27.318,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"in every way and everywhere we accept this with all gratitude. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>4,
    "start"=>32.013,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"But, to detain you no further, I beg you in your kindness to hear us briefly. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>5,
    "start"=>38,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"For we have found this man a plague, one who stirs up riots among all the Jews throughout the world and is a ringleader of the sect of the Nazarenes. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>6,
    "start"=>50.358,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"He even tried to profane the temple, but we seized him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>8,
    "start"=>55.331,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"By examining him yourself you will be able to find out from him about everything of which we accuse him.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>9,
    "start"=>55.331,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"The Jews also joined in the charge, affirming that all these things were so. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>10,
    "start"=>63.132,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"And when the governor had nodded to him to speak, Paul replied: \\\\u201cKnowing that for many years you have been a judge over this nation, I cheerfully make my defense. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>11,
    "start"=>68.093,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"You can verify that it is not more than twelve days since I went up to worship in Jerusalem, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>12,
    "start"=>78.914,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"and they did not find me disputing with anyone or stirring up a crowd, either in the temple or in the synagogues or in the city. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>13,
    "start"=>85.093,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"Neither can they prove to you what they now bring up against me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>14,
    "start"=>93.45,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"But this I confess to you, that according to the Way, which they call a sect, I worship the God of our fathers, believing everything laid down by the Law and written in the Prophets, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>15,
    "start"=>97.821,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"having a hope in God, which these men themselves accept, that there will be a resurrection of both the just and the unjust. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>16,
    "start"=>110.45,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"So I always take pains to have a clear conscience toward both God and man. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>17,
    "start"=>119.318,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"Now after several years I came to bring alms to my nation and to present offerings. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>18,
    "start"=>126.702,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"While I was doing this, they found me purified in the temple, without any crowd or tumult. But some Jews from Asia\\\\u2014 \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>19,
    "start"=>133.808,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"they ought to be here before you and to make an accusation, should they have anything against me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>20,
    "start"=>142.821,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"Or else let these men themselves say what wrongdoing they found when I stood before the council, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>148.384,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"other than this one thing that I cried out while standing among them: \\\\u2018It is with respect to the resurrection of the dead that I am on trial before you this day.\\\\u2019\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>154.384,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"But Felix, having a rather accurate knowledge of the Way, put them off, saying, \\\\u201cWhen Lysias the tribune comes down, I will decide your case.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>166.358,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"Then he gave orders to the centurion that he should be kept in custody but have some liberty, and that none of his friends should be prevented from attending to his needs. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>177.185,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"After some days Felix came with his wife Drusilla, who was Jewish, and he sent for Paul and heard him speak about faith in Christ Jesus. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>186.702,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"And as he reasoned about righteousness and self-control and the coming judgment, Felix was alarmed and said, \\\\u201cGo away for the present. When I get an opportunity I will summon you.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>26,
    "start"=>195.159,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"At the same time he hoped that money would be given him by Paul. So he sent for him often and conversed with him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>27,
    "start"=>209.556,
    "chapter_text"=>"Chapter 24",
    "verse_text"=>"When two years had elapsed, Felix was succeeded by Porcius Festus. And desiring to do the Jews a favor, Felix left Paul in prison. \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
    "chap_no"=>24,
    "book"=>"Acts",
    "part"=>109
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>1,
    "start"=>3.795,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"Now three days after Festus had arrived in the province, he went up to Jerusalem from Caesarea. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>2,
    "start"=>9.358,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"And the chief priests and the principal men of the Jews laid out their case against Paul, and they urged him, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>3,
    "start"=>15.517,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"asking as a favor against Paul that he summon him to Jerusalem\\\\u2014because they were planning an ambush to kill him on the way. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>4,
    "start"=>22.728,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"Festus replied that Paul was being kept at Caesarea and that he himself intended to go there shortly. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>5,
    "start"=>29.45,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"\\\\u201cSo,\\\\u201d said he, \\\\u201clet the men of authority among you go down with me, and if there is anything wrong about the man, let them bring charges against him.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>6,
    "start"=>38.358,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"After he stayed among them not more than eight or ten days, he went down to Caesarea. And the next day he took his seat on the tribunal and ordered Paul to be brought. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>7,
    "start"=>47.358,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"When he had arrived, the Jews who had come down from Jerusalem stood around him, bringing many and serious charges against him that they could not prove. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>8,
    "start"=>56.278,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"Paul argued in his defense, \\\\u201cNeither against the law of the Jews, nor against the temple, nor against Caesar have I committed any offense.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>9,
    "start"=>68.318,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"But Festus, wishing to do the Jews a favor, said to Paul, \\\\u201cDo you wish to go up to Jerusalem and there be tried on these charges before me?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>10,
    "start"=>77.768,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"But Paul said, \\\\u201cI am standing before Caesar\\\\u2019s tribunal, where I ought to be tried. To the Jews I have done no wrong, as you yourself know very well. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>11,
    "start"=>89.821,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"If then I am a wrongdoer and have committed anything for which I deserve to die, I do not seek to escape death. But if there is nothing to their charges against me, no one can give me up to them. I appeal to Caesar.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>12,
    "start"=>107.344,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"Then Festus, when he had conferred with his council, answered, \\\\u201cTo Caesar you have appealed; to Caesar you shall go.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>13,
    "start"=>117.079,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"Now when some days had passed, Agrippa the king and Bernice arrived at Caesarea and greeted Festus. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>14,
    "start"=>123.543,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"And as they stayed there many days, Festus laid Paul\\\\u2019s case before the king, saying, \\\\u201cThere is a man left prisoner by Felix, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>15,
    "start"=>131.675,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"and when I was at Jerusalem, the chief priests and the elders of the Jews laid out their case against him, asking for a sentence of condemnation against him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>16,
    "start"=>140.132,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"I answered them that it was not the custom of the Romans to give up anyone before the accused met the accusers face to face and had opportunity to make his defense concerning the charge laid against him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>17,
    "start"=>152.066,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"So when they came together here, I made no delay, but on the next day took my seat on the tribunal and ordered the man to be brought. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>18,
    "start"=>160.397,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"When the accusers stood up, they brought no charge in his case of such evils as I supposed. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>19,
    "start"=>165.702,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"Rather they had certain points of dispute with him about their own religion and about a certain Jesus, who was dead, but whom Paul asserted to be alive. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>20,
    "start"=>175.728,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"Being at a loss how to investigate these questions, I asked whether he wanted to go to Jerusalem and be tried there regarding them. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>183.344,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"But when Paul had appealed to be kept in custody for the decision of the emperor, I ordered him to be held until I could send him to Caesar.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>191.662,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"Then Agrippa said to Festus, \\\\u201cI would like to hear the man myself.\\\\u201d \\\\u201cTomorrow,\\\\u201d said he, \\\\u201cyou will hear him.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>200.45,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"So on the next day Agrippa and Bernice came with great pomp, and they entered the audience hall with the military tribunes and the prominent men of the city. Then, at the command of Festus, Paul was brought in. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>213.411,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"And Festus said, \\\\u201cKing Agrippa and all who are present with us, you see this man about whom the whole Jewish people petitioned me, both in Jerusalem and here, shouting that he ought not to live any longer. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>230.702,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"But I found that he had done nothing deserving death. And as he himself appealed to the emperor, I decided to go ahead and send him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>26,
    "start"=>239.808,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"But I have nothing definite to write to my lord about him. Therefore I have brought him before you all, and especially before you, King Agrippa, so that, after we have examined him, I may have something to write. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>27,
    "start"=>254.914,
    "chapter_text"=>"Chapter 25",
    "verse_text"=>"For it seems to me unreasonable, in sending a prisoner, not to indicate the charges against him.\\\\u201d \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
    "chap_no"=>25,
    "book"=>"Acts",
    "part"=>110
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>1,
    "start"=>3.291,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"So Agrippa said to Paul, \\\\u201cYou have permission to speak for yourself.\\\\u201d Then Paul stretched out his hand and made his defense: \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>2,
    "start"=>12.305,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"\\\\u201cI consider myself fortunate that it is before you, King Agrippa, I am going to make my defense today against all the accusations of the Jews, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>3,
    "start"=>23.49,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"especially because you are familiar with all the customs and controversies of the Jews. Therefore I beg you to listen to me patiently. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>4,
    "start"=>34.636,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"\\\\u201cMy manner of life from my youth, spent from the beginning among my own nation and in Jerusalem, is known by all the Jews. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>5,
    "start"=>44.252,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"They have known for a long time, if they are willing to testify, that according to the strictest party of our religion I have lived as a Pharisee. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>6,
    "start"=>54.477,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And now I stand here on trial because of my hope in the promise made by God to our fathers, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>7,
    "start"=>62.596,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"to which our twelve tribes hope to attain, as they earnestly worship night and day. And for this hope I am accused by Jews, O king! \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>8,
    "start"=>73.874,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"Why is it thought incredible by any of you that God raises the dead? \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>9,
    "start"=>79.093,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"\\\\u201cI myself was convinced that I ought to do many things in opposing the name of Jesus of Nazareth. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>10,
    "start"=>86.013,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And I did so in Jerusalem. I not only locked up many of the saints in prison after receiving authority from the chief priests, but when they were put to death I cast my vote against them. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>11,
    "start"=>99.477,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And I punished them often in all the synagogues and tried to make them blaspheme, and in raging fury against them I persecuted them even to foreign cities. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>12,
    "start"=>111.821,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"\\\\u201cIn this connection I journeyed to Damascus with the authority and commission of the chief priests. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>13,
    "start"=>120,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"At midday, O king, I saw on the way a light from heaven, brighter than the sun, that shone around me and those who journeyed with me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>14,
    "start"=>131.278,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And when we had all fallen to the ground, I heard a voice saying to me in the Hebrew language, \\\\u2018Saul, Saul, why are you persecuting me? It is hard for you to kick against the goads.\\\\u2019 \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>15,
    "start"=>147.49,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And I said, \\\\u2018Who are you, Lord?\\\\u2019And the Lord said, \\\\u2018I am Jesus whom you are persecuting. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>16,
    "start"=>156.225,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"But rise and stand upon your feet, for I have appeared to you for this purpose, to appoint you as a servant and witness to the things in which you have seen me and to those in which I will appear to you, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>17,
    "start"=>169.318,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"delivering you from your people and from the Gentiles\\\\u2014to whom I am sending you \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>18,
    "start"=>174.093,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"to open their eyes, so that they may turn from darkness to light and from the power of Satan to God, that they may receive forgiveness of sins and a place among those who are sanctified by faith in me.\\\\u2019 \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>19,
    "start"=>187.927,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"\\\\u201cTherefore, O King Agrippa, I was not disobedient to the heavenly vision, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>20,
    "start"=>194.887,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"but declared first to those in Damascus, then in Jerusalem and throughout all the region of Judea, and also to the Gentiles, that they should repent and turn to God, performing deeds in keeping with their repentance. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>209.424,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"For this reason the Jews seized me in the temple and tried to kill me. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>215.185,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"To this day I have had the help that comes from God, and so I stand here testifying both to small and great, saying nothing but what the prophets and Moses said would come to pass: \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>228.291,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"that the Christ must suffer and that, by being the first to rise from the dead, he would proclaim light both to our people and to the Gentiles.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>239.662,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And as he was saying these things in his defense, Festus said with a loud voice, \\\\u201cPaul, you are out of your mind; your great learning is driving you out of your mind.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>252.609,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"But Paul said, \\\\u201cI am not out of my mind, most excellent Festus, but I am speaking true and rational words. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>26,
    "start"=>261.305,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"For the king knows about these things, and to him I speak boldly. For I am persuaded that none of these things has escaped his notice, for this has not been done in a corner. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>27,
    "start"=>273.053,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"King Agrippa, do you believe the prophets? I know that you believe.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>28,
    "start"=>279.914,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And Agrippa said to Paul, \\\\u201cIn a short time would you persuade me to be a Christian?\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>29,
    "start"=>287.49,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And Paul said, \\\\u201cWhether short or long, I would to God that not only you but also all who hear me this day might become such as I am\\\\u2014except for these chains.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>30,
    "start"=>299.98,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"Then the king rose, and the governor and Bernice and those who were sitting with them. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>31,
    "start"=>304.715,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And when they had withdrawn, they said to one another, \\\\u201cThis man is doing nothing to deserve death or imprisonment.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>32,
    "start"=>313.821,
    "chapter_text"=>"Chapter 26",
    "verse_text"=>"And Agrippa said to Festus, \\\\u201cThis man could have been set free if he had not appealed to Caesar.\\\\u201d \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
    "chap_no"=>26,
    "book"=>"Acts",
    "part"=>111
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>1,
    "start"=>4.066,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"And when it was decided that we should sail for Italy, they delivered Paul and some other prisoners to a centurion of the Augustan Cohort named Julius. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>2,
    "start"=>12.596,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"And embarking in a ship of Adramyttium, which was about to sail to the ports along the coast of Asia, we put to sea, accompanied by Aristarchus, a Macedonian from Thessalonica. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>3,
    "start"=>25.358,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"The next day we put in at Sidon. And Julius treated Paul kindly and gave him leave to go to his friends and be cared for. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>4,
    "start"=>32.649,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"And putting out to sea from there we sailed under the lee of Cyprus, because the winds were against us. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>5,
    "start"=>39.344,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"And when we had sailed across the open sea along the coast of Cilicia and Pamphylia, we came to Myra in Lycia. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>6,
    "start"=>46.755,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"There the centurion found a ship of Alexandria sailing for Italy and put us on board. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>7,
    "start"=>52.623,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"We sailed slowly for a number of days and arrived with difficulty off Cnidus, and as the wind did not allow us to go farther, we sailed under the lee of Crete off Salmone. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>8,
    "start"=>64.159,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"Coasting along it with difficulty, we came to a place called Fair Havens, near which was the city of Lasea. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>9,
    "start"=>71.199,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"Since much time had passed, and the voyage was now dangerous because even the Fast was already over, Paul advised them, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>10,
    "start"=>78.702,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"saying, \\\\u201cSirs, I perceive that the voyage will be with injury and much loss, not only of the cargo and the ship, but also of our lives.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>11,
    "start"=>89.755,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"But the centurion paid more attention to the pilot and to the owner of the ship than to what Paul said. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>12,
    "start"=>95.278,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"And because the harbor was not suitable to spend the winter in, the majority decided to put out to sea from there, on the chance that somehow they could reach Phoenix, a harbor of Crete, facing both southwest and northwest, and spend the winter there. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>13,
    "start"=>110.887,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"Now when the south wind blew gently, supposing that they had obtained their purpose, they weighed anchor and sailed along Crete, close to the shore. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>14,
    "start"=>120.225,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"But soon a tempestuous wind, called the northeaster, struck down from the land. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>15,
    "start"=>125.503,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"And when the ship was caught and could not face the wind, we gave way to it and were driven along. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>16,
    "start"=>131.291,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"Running under the lee of a small island called Cauda, we managed with difficulty to secure the ship\\\\u2019s boat. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>17,
    "start"=>138,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"After hoisting it up, they used supports to undergird the ship. Then, fearing that they would run aground on the Syrtis, they lowered the gear, and thus they were driven along. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>18,
    "start"=>148.808,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"Since we were violently storm-tossed, they began the next day to jettison the cargo. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>19,
    "start"=>153.821,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"And on the third day they threw the ship\\\\u2019s tackle overboard with their own hands. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>20,
    "start"=>158.238,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"When neither sun nor stars appeared for many days, and no small tempest lay on us, all hope of our being saved was at last abandoned. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>21,
    "start"=>167.954,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"Since they had been without food for a long time, Paul stood up among them and said, \\\\u201cMen, you should have listened to me and not have set sail from Crete and incurred this injury and loss. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>22,
    "start"=>180.464,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"Yet now I urge you to take heart, for there will be no loss of life among you, but only of the ship. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>23,
    "start"=>187.861,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"For this very night there stood before me an angel of the God to whom I belong and whom I worship, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>24,
    "start"=>194.887,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"and he said, \\\\u2018Do not be afraid, Paul; you must stand before Caesar. And behold, God has granted you all those who sail with you.\\\\u2019 \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>25,
    "start"=>205.106,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"So take heart, men, for I have faith in God that it will be exactly as I have been told. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>26,
    "start"=>211.556,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"But we must run aground on some island.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>27,
    "start"=>216.331,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"When the fourteenth night had come, as we were being driven across the Adriatic Sea, about midnight the sailors suspected that they were nearing land. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>28,
    "start"=>225.437,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"So they took a sounding and found twenty fathoms. A little farther on they took a sounding again and found fifteen fathoms. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>29,
    "start"=>232.715,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"And fearing that we might run on the rocks, they let down four anchors from the stern and prayed for day to come. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>30,
    "start"=>239.689,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"And as the sailors were seeking to escape from the ship, and had lowered the ship\\\\u2019s boat into the sea under pretense of laying out anchors from the bow, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>31,
    "start"=>248.132,
    "chapter_text"=>"Chapter 27",
    "verse_text"=>"Paul said to the centurion and the soldiers, \\\\u201cUnless these men stay in the ship, you cannot be saved.\\\\u201d \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>27,
    "book"=>"Acts",
    "part"=>112
  },
  {
    "no"=>59,
    "book_sid"=>"Acts",
    "verse"=>32,
