    "verse_text"=>"I am speaking in human terms, because of your natural limitations. For just as you once presented your members as slaves to impurity and to lawlessness leading to more lawlessness, so now present your members as slaves to righteousness leading to sanctification. \\\\n\\\\t\\\\t\\\\t",
