    "chapter_text"=>"Chapter 7",
    "verse_text"=>"Or do you not know, brothers\\\\u2014for I am speaking to those who know the law\\\\u2014that the law is binding on a person only as long as he lives? \\\\n\\\\t\\\\t\\\\t",
