    "book"=>"1 John",
    "part"=>212
  },
  {
    "no"=>77,
    "book_sid"=>"1John",
    "verse"=>18,
    "start"=>153.57,
    "chapter_text"=>"Chapter 4",
    "verse_text"=>"There is no fear in love, but perfect love casts out fear. For fear has to do with punishment, and whoever fears has not been perfected in love. \\\\n\\\\t\\\\t\\\\t",
