    "book_sid"=>"1John",
    "verse"=>20,
    "start"=>168.013,
    "chapter_text"=>"Chapter 4",
    "verse_text"=>"If anyone says, \\\\u201cI love God,\\\\u201d and hates his brother, he is a liar; for he who does not love his brother whom he has seen cannot love God whom he has not seen. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>4,
