    "book_sid"=>"1John",
    "verse"=>21,
    "start"=>179.98,
    "chapter_text"=>"Chapter 4",
    "verse_text"=>"And this commandment we have from him: whoever loves God must also love his brother. \\\\n\\\\t\\\\t\\\\n\\\\t\\\\t",
    "chap_no"=>4,
    "book"=>"1 John",
    "part"=>212
  },
  {
    "no"=>77,
    "book_sid"=>"1John",
    "verse"=>1,
    "start"=>4,
    "chapter_text"=>"Chapter 5",
    "verse_text"=>"Everyone who believes that Jesus is the Christ has been born of God, and everyone who loves the Father loves whoever has been born of him. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>5,
    "book"=>"1 John",
    "part"=>213
  },
  {
    "no"=>77,
    "book_sid"=>"1John",
    "verse"=>2,
    "start"=>13.371,
    "chapter_text"=>"Chapter 5",
    "verse_text"=>"By this we know that we love the children of God, when we love God and obey his commandments. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>5,
    "book"=>"1 John",
    "part"=>213
  },
  {
    "no"=>77,
    "book_sid"=>"1John",
    "verse"=>3,
    "start"=>20,
    "chapter_text"=>"Chapter 5",
