    "part"=>213
  },
  {
    "no"=>77,
    "book_sid"=>"1John",
    "verse"=>13,
    "start"=>103.503,
    "chapter_text"=>"Chapter 5",
    "verse_text"=>"I write these things to you who believe in the name of the Son of God that you may know that you have eternal life. \\\\n\\\\t\\\\t\\\\t",
