    "book"=>"1 John",
    "part"=>213
  },
  {
    "no"=>77,
    "book_sid"=>"1John",
    "verse"=>14,
    "start"=>110.742,
    "chapter_text"=>"Chapter 5",
    "verse_text"=>"And this is the confidence that we have toward him, that if we ask anything according to his will he hears us. \\\\n\\\\t\\\\t\\\\t",
