    "verse_text"=>"If anyone sees his brother committing a sin not leading to death, he shall ask, and God will give him life\\\\u2014to those who commit sins that do not lead to death. There is sin that leads to death; I do not say that one should pray for that. \\\\n\\\\t\\\\t\\\\t",
