    "book_sid"=>"1John",
    "verse"=>21,
    "start"=>182,
    "chapter_text"=>"Chapter 5",
    "verse_text"=>"Little children, keep yourselves from idols. \\\\n\\\\n\\\\t\\\\t\\\\n\\\\t",
    "chap_no"=>5,
