    "book_sid"=>"2John",
    "verse"=>4,
    "start"=>26.238,
    "chapter_text"=>"Chapter 1",
    "verse_text"=>"I rejoiced greatly to find some of your children walking in the truth, just as we were commanded by the Father. \\\\n\\\\t\\\\t\\\\t",
