    "verse"=>7,
    "start"=>52.808,
    "chapter_text"=>"Chapter 1",
    "verse_text"=>"For many deceivers have gone out into the world, those who do not confess the coming of Jesus Christ in the flesh. Such a one is the deceiver and the antichrist. \\\\n\\\\t\\\\t\\\\t",
