    "book_sid"=>"2John",
    "verse"=>8,
    "start"=>64.265,
    "chapter_text"=>"Chapter 1",
    "verse_text"=>"Watch yourselves, so that you may not lose what we have worked for, but may win a full reward. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>1,
    "book"=>"2 John",
    "part"=>213
  },
  {
    "no"=>78,
    "book_sid"=>"2John",
    "verse"=>9,
    "start"=>71.318,
    "chapter_text"=>"Chapter 1",
    "verse_text"=>"Everyone who goes on ahead and does not abide in the teaching of Christ, does not have God. Whoever abides in the teaching has both the Father and the Son. \\\\n\\\\t\\\\t\\\\t",
