    "book_sid"=>"2John",
    "verse"=>10,
    "start"=>81.503,
    "chapter_text"=>"Chapter 1",
    "verse_text"=>"If anyone comes to you and does not bring this teaching, do not receive him into your house or give him any greeting, \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>1,
    "book"=>"2 John",
