    "chapter_text"=>"Chapter 1",
    "verse_text"=>"Though I have much to write to you, I would rather not use paper and ink. Instead I hope to come to you and talk face to face, so that our joy may be complete. \\\\n\\\\t\\\\t\\\\t",
