    "verse"=>2,
    "start"=>6.861,
    "chapter_text"=>"Chapter 1",
    "verse_text"=>"Beloved, I pray that all may go well with you and that you may be in good health, as it goes well with your soul. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>1,
    "book"=>"3 John",
    "part"=>213
