    "verse"=>10,
    "start"=>62.318,
    "chapter_text"=>"Chapter 1",
    "verse_text"=>"So if I come, I will bring up what he is doing, talking wicked nonsense against us. And not content with that, he refuses to welcome the brothers, and also stops those who want to and puts them out of the church. \\\\n\\\\t\\\\t\\\\t",
    "chap_no"=>1,
    "book"=>"3 John",
    "part"=>213
  },
  {
    "no"=>79,
    "book_sid"=>"3John",
    "verse"=>11,
    "start"=>76.94,
    "chapter_text"=>"Chapter 1",
    "verse_text"=>"Beloved, do not imitate evil but imitate good. Whoever does good is from God; whoever does evil has not seen God. \\\\n\\\\t\\\\t\\\\t",
